INSERT INTO `tbl_posts` (`id`, `autor`, `title`, `content`, `is_active`, `created_at`)
VALUES
	(1,'Facebook','Escribir marcado con JSX','<p><em><b><br></b></em></p><p><em><b>JSX</b></em> es una extensión de sintaxis para JavaScript que permite \r\nescribir marcado similar a HTML dentro de una archivo JavaScript. Aunque\r\n hay otras formas de escribir componentes, la mayoría de los \r\ndesarrolladores de <font color=\"#0000ff\">React</font> prefieren la concisión de JSX, y la mayoría de \r\nlas bases de código lo usan.</p><p><img style=\"width: 1048px;\" src=\"data:image/png;base64,\" data-filename=\"retina_1708x683_staging.toptal.net_javascript_emulating-react-jsx-in-vanilla-javascript-816eafe06505b888585d08474f2166e7.png\"><br></p><p>Se llama JSX, y es una extensión de la sintaxis de JavaScript. \r\nRecomendamos usarlo con React para describir cómo debería ser la \r\ninterfaz de usuario. JSX puede recordarte a un lenguaje de plantillas, \r\npero viene con todo el poder de JavaScript.</p><p><br></p><p><br></p><p><br></p>',1,'2024-02-05 01:41:28.478295'),
	(2,'Urian Viera','¿Qué es Python?','<p><br></p><p><span class=\"ILfuVd\" lang=\"es\"><span class=\"hgKElc\">Python es un <b>lenguaje\r\n de programación ampliamente utilizado en las aplicaciones web, el \r\ndesarrollo de software, la ciencia de datos y el machine learning (ML)</b>.\r\n Los desarrolladores utilizan Python porque es eficiente y fácil de \r\naprender, además de que se puede ejecutar en muchas plataformas \r\ndiferentes.</span></span></p><p><img style=\"width: 1048px;\" src=\"data:image/jpeg;base64,\" data-filename=\"Django-1024x576-1.jpg\"><span class=\"ILfuVd\" lang=\"es\"><span class=\"hgKElc\"><br></span></span></p><p><span class=\"ILfuVd\" lang=\"es\"><span class=\"hgKElc\"><font color=\"#ff0000\"><b>Django es un framework de desarrollo para Python que se emplea para la creación de páginas web</b>.</font>\r\n Se trata de una herramienta de código abierto y gratuita que cuenta con\r\n una comunidad amplia y que comparte recursos constantemente.</span></span></p>',1,'2024-02-05 01:44:27.408364'),
	(3,'Urian Viera','¿Qué es Gemini?','<p><br></p><p><br></p><div class=\"article-main__content\" data-test-id=\"publishing-text-block\">\r\n        <p>\r\n          <span class=\"font-[700]\"><font color=\"#0000ff\">Gemini </font></span><span class=\"\">es un modelo de lenguaje </span><span class=\"font-[700]\">multimodal</span><span class=\"\">\r\n desarrollado por <font color=\"#ff9c00\">Google</font> AI. Está entrenado en un conjunto de datos \r\nmasivo de texto, imágenes, audio y código. Esto le permite generar \r\ntexto, traducir idiomas, escribir diferentes tipos de contenido creativo\r\n y responder preguntas de manera informativa.</span></p><p><img style=\"width: 1048px;\" src=\"data:image/png;base64,\" data-filename=\"1705603889278.png\"><span class=\"\"><br></span>\r\n        </p>\r\n    </div>\r\n  \r\n                \r\n\r\n    <div class=\"article-main__content\" data-test-id=\"publishing-text-block\">\r\n        <p>\r\n          <span class=\"\">En el contexto de la inteligencia artificial, </span><span class=\"font-[700]\">multimodal</span><span class=\"\">\r\n se refiere a la capacidad de un modelo de IA para procesar diferentes \r\ntipos de información. Por ejemplo, un modelo de IA multimodal puede ser \r\nentrenado en un conjunto de datos que incluye texto, imágenes y audio. \r\n<b>Esto le permite al modelo realizar tareas que requieren la comprensión \r\nde diferentes tipos de información, como la traducción automática, la \r\ngeneración de texto creativo y el análisis de sentimientos.</b></span>\r\n        </p>\r\n    </div><p></p>',1,'2024-02-05 01:46:08.188180');
