VALUES
	(8,'Urian Viera','Crud con Nodejs','<p><br></p><p><b>Crud completo con Node js y <font color=\"#0000ff\">MySQL</font></b></p><p>Este proyecto es una aplicación CRUD (Crear, Leer, Actualizar y Borrar) en Node.js utilizando el framework Express y la biblioteca `mysql2` para interactuar con una base de datos MySQL.</p><p><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/p2j0YcpNx20\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><br></p><p><br></p>',1,'2024-02-06 00:41:52.547585'),
	(9,'Urian Viera','Crud con Python','<p><b>Crud completo con Node js y MySQL</b></p><p>Este proyecto es una aplicación CRUD <font color=\"#0000ff\">(Crear, Leer, Actualizar y Borrar)</font> en Node.js utilizando el framework Express y la biblioteca `mysql2` para interactuar con una base de datos MySQL.</p><p><br></p><p><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/gXYJEnkK_JQ?start=357\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><br></p>',1,'2024-02-06 01:00:59.822894'),
	(10,'Abelardo Perez','¿Qué es Flutter?','<p style=\"margin-bottom: 15px; color: rgb(51, 51, 51); font-family: AmazonEmber, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">Flutter es un marco de código abierto desarrollado y compatible con Google. Los desarrolladores de front-end y pila completa utilizan Flutter para crear una interfaz de usuario (IU) de aplicación para varias plataforma con un único código base.</p><p style=\"margin-top: 15px; margin-bottom: 0px; padding-top: 5px; color: rgb(51, 51, 51); font-family: AmazonEmber, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"background-color: rgb(156, 0, 255);\">Cuando Flutter se lanzó, en 2018, era compatible principalmente con el desarrollo de aplicaciones móviles. Ahora, Flutter es compatible con el desarrollo de aplicaciones en seis plataformas: iOS, Android, web, Windows, MacOS y Linux.</span></p><p style=\"margin-top: 15px; margin-bottom: 0px; padding-top: 5px; color: rgb(51, 51, 51); font-family: AmazonEmber, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"><br></p><p style=\"margin-top: 15px; margin-bottom: 0px; padding-top: 5px; color: rgb(51, 51, 51); font-family: AmazonEmber, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"><img src=\"data:image/png;base64,\" data-filename=\"descarga.png\" style=\"width: 254px;\"><br></p><h2 class=\"lb-txt-bold lb-txt-none lb-txt-28 lb-h2 lb-title\" id=\"seo-faq-pairs#what-are-widgets\" style=\"margin: 15px 0px; text-rendering: optimizelegibility; font-family: AmazonEmberBold, &quot;Helvetica Neue Bold&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 2.8rem; line-height: 1.3; overflow-wrap: break-word; background-color: rgb(251, 251, 251);\"><font color=\"#ff0000\">¿Qué son los widgets en Flutter?</font></h2><div class=\"lb-txt-14 lb-rtxt\" style=\"margin-top: 15px; margin-bottom: 15px; overflow-wrap: break-word; font-size: 14px; line-height: 1.6; color: rgb(51, 51, 51); font-family: AmazonEmber, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(251, 251, 251);\"><p style=\"margin-bottom: 15px;\">En Flutter, los desarrolladores crean diseños de interfaz de usuario mediante el uso de&nbsp;<i>widgets</i>. Esto significa que todo lo que un usuario ve en una pantalla, desde las ventanas y paneles hasta los botones y textos, está hecho de&nbsp;<i>widgets</i>.</p><h2 style=\"margin-top: 15px; margin-bottom: 15px; padding-top: 5px;\"><span style=\"font-family: &quot;Comic Sans MS&quot;; font-size: 14px;\">Los&nbsp;</span><i style=\"\"><span style=\"font-size: 14px;\">widgets</span></i><span style=\"font-family: &quot;Comic Sans MS&quot;; font-size: 14px;\">&nbsp;de Flutter están diseñados para que los desarrolladores puedan personalizarlos fácilmente. Flutter logra esto a través de un enfoque de composición. Esto significa que la mayoría de los&nbsp;</span><i style=\"\"><span style=\"font-size: 14px;\">widgets</span></i><span style=\"font-family: &quot;Comic Sans MS&quot;; font-size: 14px;\">&nbsp;están formados por otros más pequeños y que los más básicos tienen propósitos específicos. Esto permite a los desarrolladores combinar o editar&nbsp;</span><i style=\"\"><span style=\"font-size: 14px;\">widgets</span></i><span style=\"font-family: &quot;Comic Sans MS&quot;; font-size: 14px;\">&nbsp;para crear otros nuevos.</span></h2></div>',1,'2024-02-06 01:02:39.384058'),
	(12,'Abelardo Perez','¿Qué es React y para qué sirve?','<h3 style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-stretch: inherit; font-size: var(--cl-text-font-size, 1rem); line-height: var(--cl-text-line-height, 1.75); font-family: &quot;Lexend Deca&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; margin: 1em 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 51, 67);\"><u style=\"\">Si tu objetivo es crear un sitio web con un rendimiento y una velocidad de carga más rápida que el promedio, lo puedes hacer con ayuda de un código abierto. React cuenta con todos los recursos necesarios para que crees una interfaz de usuario dinámica y sin problemas de actualización.&nbsp;</u></h3><h3 style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-stretch: inherit; font-size: var(--cl-text-font-size, 1rem); line-height: var(--cl-text-line-height, 1.75); font-family: &quot;Lexend Deca&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; margin: 1em 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 51, 67);\"><img src=\"data:image/png;base64,\" data-filename=\"react.png\" style=\"width: 300px;\"><u style=\"\"><br></u></h3><p style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-stretch: inherit; font-size: var(--cl-text-font-size, 1rem); line-height: var(--cl-text-line-height, 1.75); font-family: &quot;Lexend Deca&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; margin: 1em 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 51, 67);\"><span style=\"font-family: &quot;Courier New&quot;;\">Al ser de código de abierto tienes grandes ventajas, pues la plataforma se desarrolla con base en una filosofía de la colaboración entre varios usuarios. De esta manera, sus funciones van creciendo sin que haya costos adicionales.</span></p><p style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-stretch: inherit; font-size: var(--cl-text-font-size, 1rem); line-height: var(--cl-text-line-height, 1.75); font-family: &quot;Lexend Deca&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; margin: 1em 0px; padding: 0px; vertical-align: baseline;\"><span style=\"color: rgb(33, 51, 67);\">Cuando un software</span><font color=\"#0000ff\"> es de código abierto las licencias de uso están abiertas, entonces puedes usarlo libremente cuando quieras y en la forma en que desees. Además puedes hacer mejoras o personalizaciones de configuración y código con</font><font color=\"#213343\"> base en las necesidades que tenga tu negocio.</font></p>',1,'2024-02-07 02:23:27.359621'),
	(13,'Urian Viera','CRUD Completo con Python - Django y MySQL','<p><span style=\"color: rgb(99, 99, 99); font-family: Inter, sans-serif; font-size: 15px; background-color: rgb(248, 249, 250);\">Crud aprenderas a realizar las operaciones básicas como: crear, leer, actualizar y eliminar registros en una base de datos MySQL, también ofrece la posibilidad de </span><font color=\"#ff9c00\">cargar datos desde un archivo Excel en la base de datos MySQL, así como exportar registros de la base de datos a archivos Excel, entre muchas cosas más.</font></p><p><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/kzomTvQNnkY\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><font color=\"#ff9c00\"><br></font></p><p><span style=\"color: rgb(99, 99, 99); font-family: &quot;Comic Sans MS&quot;; font-size: 15px; background-color: rgb(248, 249, 250);\">Crud aprenderas a realizar las operaciones básicas como: crear, leer, actualizar y eliminar registros en una base de datos MySQL, también ofrece la posibilidad de cargar datos desde un archivo Excel en la base de datos MySQL, así como exportar registros de la base de datos a archivos Excel, entre muchas cosas más.</span><font color=\"#ff9c00\"><br></font><br></p>',1,'2024-02-07 02:25:27.152815'),
	(14,'Brenda Viera','Cómo utilizar el editor Summernote en Python y Django','<p><span style=\"color: rgb(99, 99, 99); font-family: Inter, sans-serif; font-size: 15px; background-color: rgb(248, 249, 250);\">El proy</span><span style=\"font-family: &quot;Courier New&quot;; font-size: 15px; background-color: rgb(248, 249, 250);\"><font color=\"#0000ff\">ecto \'Gestor de Posts con Editor Summernote en Django\' se centra en la creación de una aplicación web utilizando el framework Django de Python. El objetivo principal es permitir a los usuarios crear y gestionar publicaciones de manera intuitiva y dinámica mediante el uso del editor de texto enriquecido Summernote.</font></span></p><p><span style=\"font-family: &quot;Courier New&quot;; font-size: 15px; background-color: rgb(248, 249, 250);\"><font color=\"#0000ff\"><br></font></span></p><p><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/mMG9FmVo8DE\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><span style=\"font-family: &quot;Courier New&quot;; font-size: 15px; background-color: rgb(248, 249, 250);\"><font color=\"#0000ff\"><br></font></span></p><p><span style=\"font-family: &quot;Courier New&quot;; font-size: 15px; background-color: rgb(248, 249, 250);\"><font color=\"#0000ff\"><br></font></span><br></p>',1,'2024-02-07 02:40:40.502963'),
	(16,'josefina','php','<p align=\"justify\" style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; border: 0px; font-size: 17px; vertical-align: baseline; color: rgb(255, 255, 255); font-family: Nunito, sans-serif; letter-spacing: 0.162px; background-color: rgb(19, 20, 23);\">CURRENT_TIMESTAMP()&nbsp;<a href=\"https://www.geeksforgeeks.org/sql-functions-aggregate-scalar-functions/\" rel=\"noopener\" target=\"_blank\" style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; outline: none; color: var(--color-gfg); text-decoration-line: underline; display: inline; word-break: break-word;\">function in MySQL</a>&nbsp;is used to check the current date and time value. In MySQL function, CURRENT_TIMESTAMP is needed when you need to keep a record of the exact time of delivery which is helpful in improving the services and functionalities of any organization. The format of this function is in the form of the current date and time value in YYYY-MM-DD HH:MM: SS or YYYYMMDDHHMMSS.uuu format, depending on whether the function is used in a string or numeric context.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; border: 0px; font-size: 17px; vertical-align: baseline; color: rgb(255, 255, 255); font-family: Nunito, sans-serif; letter-spacing: 0.162px; background-color: rgb(19, 20, 23);\">Let’s consider an example for a better understanding if you have bought or like you have used courier service then you will see they will provide you a unique ID to keep update and trace your product location is in case of courier and In case of buying you will get the update by where exactly your product is and when you will get and the expected date etc. all the information you will get. In both cases, CURRENT_FUNCTION is needed to keep track of the current time of delivery location.</p>',1,'2024-02-07 12:11:28.083489');
